const stringify=e=>"type"in e?stringifyToken(e):stringifyItem(e);function stringifyToken(e){switch(e.type){case"block-scalar":{let t="";for(const o of e.props)t+=stringifyToken(o);return t+e.source}case"block-map":case"block-seq":{let t="";for(const o of e.items)t+=stringifyItem(o);return t}case"flow-collection":{let t=e.start.source;for(const o of e.items)t+=stringifyItem(o);for(const o of e.end)t+=o.source;return t}case"document":{let t=stringifyItem(e);if(e.end)for(const o of e.end)t+=o.source;return t}default:{let t=e.source;if("end"in e&&e.end)for(const o of e.end)t+=o.source;return t}}}function stringifyItem({start:e,key:t,sep:o,value:n}){let r="";for(const t of e)r+=t.source;if(t&&(r+=stringifyToken(t)),o)for(const e of o)r+=e.source;return n&&(r+=stringifyToken(n)),r}export{stringify};